import React, { Component } from 'react';
import './App.css';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      datas: []
    };
  }
    componentDidMount(){
      fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(datas => {
        let usersListe = datas.map((datas) =>{return (
          <div key={datas.name}>
          </div>
        )})
        this.setState({usersListe: usersListe})
        console.log(this.state.usersListe)
      })
    }
  render(){
    return (
      <div className="App">
        <div>
          <h1>Users List</h1>
          {this.state.usersListe}
        </div>
      </div>
    );
  }
}

export default App;
